export function getMembersCount() {
    try {
      const response = fetch(
        'http://localhost:2323/api/members'
      );
      const json = response.json;
      const membersCounter=JSON.stringify(json);
      return (membersCounter);
    } catch (error) {
      console.error(error);
    }
  };
